INSERT INTO `tbl_article` (`article_id`, `article_title`, `article_author`, `article_time`, `article_body`) VALUES
('Article-ID_20220519_055045', 'BMI (Body Mass Index)', 'User.ID_20220518.154601', '2022-05-19 03:48:00.000000', '<p><strong>Body Mass Index (BMI)</strong>&nbsp;adalah indikator yang mendeteksi apakah anda kekurangan atau berlebihan berat badan.</p>\r\n\r\n<blockquote>\r\n<p>Badan yang sehat adalah badan yang memiliki BMI Normall</p>\r\n</blockquote>\r\n\r\n<p>Untuk menjadi sehat ya harus olahraga yang teratur&nbsp;</p>\r\n'),
('Article-ID_20220519_061411', 'Berita Milan, Siap Sambar Rodrygo yang Tergusur Mbappe', 'User.ID_20220518.154601', '2022-05-18 04:13:00.000000', '<p><em>Berita <a href=\"https://www.tribunnews.com/tag/milan\">Milan</a>, Siap Sambar <a href=\"https://www.tribunnews.com/tag/rodrygo\">Rodrygo</a> yang Tergusur Mbappe, Romagnoli Jadi Rebutan Barca dan Chelsea</em></p>\r\n\r\n<p><strong>TRIBUNNEWS.COM</strong> - Kedatangan Kylian Mbappe ke Real Madrid dilaporkan akan menggusur keberadaan <a href=\"https://www.tribunnews.com/tag/rodrygo\">Rodrygo</a> di tim utama.</p>\r\n\r\n<p>Sang pemain disebutkan menuju pintu keluar Bernabeu. Situasi itu dipantau <a href=\"https://www.tribunnews.com/tag/ac-milan\">AC </a><a href=\"https://www.tribunnews.com/tag/milan\">Milan</a> yang siap menyambar <a href=\"https://www.tribunnews.com/tag/rodrygo\">Rodrygo</a> .</p>\r\n\r\n<p>Menurut apa yang dilaporkan oleh <em>El Nacional</em> (via Calciomercato.it), nama Rodrygo kemungkinan masuk dalam daftar pemain yang dijual Real karena kedatangan fenomenal Kylian Mbappe.</p>\r\n\r\n<p>Kedatangan bintang Timnas Prancis itu ke skuad El Real, diyakini secara signifikan mengurangi waktu bermain yang tersedia untuk sang penyerang.</p>\r\n\r\n<p>Sumber laporan itu mengklaim bahwa Bayern Munich, Juventus, Borussia Dortmund, dan <a href=\"https://www.tribunnews.com/tag/ac-milan\">AC </a><a href=\"https://www.tribunnews.com/tag/milan\">Milan</a> bersiap memperebutkan gelandang serang tersebut.</p>\r\n\r\n<p>Beberapa tim bahkan telah mulai mempelajari kemungkinan melakukan penawaran.</p>\r\n\r\n<p>Selain klub-klub raksasa di atas, dua tim dari Liga Premier Inggris disebut juga tertarik mendatangkan pemain asal Brasil itu.</p>\r\n\r\n<p>Manchester United dan Liverpool menjadi tim yang dilaporkan terpikat oleh kemampuan <a href=\"https://www.tribunnews.com/tag/rodrygo\">Rodrygo</a>.</p>\r\n\r\n<p>Singkatnya, transfer Rodrygo&nbsp; akan menjadi pengejaran yang jauh dari kata mudah bagi Rossoneri.</p>\r\n\r\n<p>Bek <a href=\"https://www.tribunnews.com/tag/ac-milan\">AC </a><a href=\"https://www.tribunnews.com/tag/milan\">Milan</a>, <a href=\"https://www.tribunnews.com/tag/alessio-romagnoli\">Alessio Romagnoli</a> menarik minat sejumlah klub Eropa.</p>\r\n\r\n<p>Menurut laporan media Spanyol, Mundo Deportivo (via <a href=\"https://www.tribunnews.com/tag/milan\">Milan</a>News), Barcelona adalah salah satu tim yang tertarik untuk mengontrak Romagnoli dengan status bebas transfer.</p>\r\n\r\n<p>Kontrak Romagnoli memang akan berakhir pada akhir bulan depan.</p>\r\n\r\n<p>Sang pemain belum menunjukkan tanda-tanda segera menandatangani perpanjangan kontrak di <a href=\"https://www.tribunnews.com/tag/milan\">Milan</a> dalam waktu dekat.</p>\r\n\r\n<p>Peluang itu yang diintip Barcelona.</p>\r\n\r\n<p>Namun, raksasa LaLiga itu akan menghadapi persaingan dari Chelsea untuk mendapatkan Romagnoli.</p>\r\n\r\n<p>The Blues memang tengah mencari bek anyar mengingat mereka segera kehilangan <a href=\"https://www.tribunnews.com/tag/andreas-christensen\">Andreas Christensen</a> yang hijrah ke Barcelona dan Antonio Rudiger yang pindah ke Real Madrid.</p>\r\n\r\n<p>Selain Barca dan Chelsea, Bayern Munich juga tertarik pada Romagnoli.</p>\r\n\r\n<p>Muenchen perlu memperkuat pertahanan mereka setelah kepergian S&uuml;le ke Borussia Dortmund.</p>\r\n\r\n<p>Sevilla juga tertarik pada sang pemain mengingat mereka kemungkinan besar akan kehilangan Kounde.</p>\r\n\r\n<p>Salah satu daya tarik utama Romagnoli adalah fakta bahwa ia bermain kidal, fitur yang cukup jarang di antara para bek Eropa.</p>\r\n');

